                'provider' => NULL,
                'content' => '1. Go to Personnel->User-list from the sidebar. An existing user list will appear. 
2. Click on NEW to add new user.  3. Fill the form with valid information and select the role and submit the form and it will create a new user.  4. Information can be edited and user can be deleted from the vendor list.  5. Clicking filter icon, status and role filter will appear by which user can be searched by their status and role.  6. User list can be exported in two ways. One as CSV file and another is PDF file  Note ',
                'vector' => NULL,
