            13 => 
            array (
                'id' => 59,
                'parent_id' => NULL,
                'user_id' => 1,
                'name' => 'docs',
                'original_name' => 'https://docs.martvill.techvill.net/admin/commission/',
                'type' => 'url',
                'provider' => NULL,
                'content' => 'Commission in the MartVill defines as Admin Revenue. Commission will be deducted from every order. There are three levels of commission, First one is Vendor, Second is Category based and third is default. You can set the percentage of the commission while adding a vendor to the system. When customer purchase any product of that vendor, commission will be cut off according to the percentage.  You can set the percentage of the commission while adding a root category or a sub category to the system. If Vendor does not have commission set then the category based commission will be counted. Commission will be cut off according to the category on every order.  If Vendor and Category has no commission percentage given then the commission will get the default percentage. It can be configured from the Vendor part of Product Configuration. After every payment of the order, the commission price will be added to admin wallet and it can be seen in the Admin Dashboard and Transaction. And Vendor will be able to see the amount after cutting the commission in the Dashboard and their transaction.  ',
                'vector' => NULL,
                'category' => 'widgetChatBot',
                'created_at' => offsetDate(-3),
            ),
            14 => 
            array (
                'id' => 60,
                'parent_id' => NULL,
                'user_id' => 1,
                'name' => 'docs',
                'original_name' => 'https://docs.martvill.techvill.net/admin/product/',
                'type' => 'url',
                'provider' => NULL,
            'content' => 'Before adding a product, lets get familiar with Product type.   Category: can be created, edited at any time by following category adding process in categories.  Choosing Simple product as Product type   SKU: Stock Keeping Unit number, is a unique number assigned to a product to keep the track of its inventory. The SKU field can accept up to 255 characters, which can include alphanumeric values and some special characters. Manage stock: It allows you to manage inventory for the product individually and gives you the options to allow back orders and more. Enable Manage Stock must be selected in Products Inventory; otherwise, only the ‘Stock status’ option is visible in the Product Data Inventory section.  Options when Stock Manage is enabled.  if Manage Stock at product level is disabled. You are responsible for updating the Stock Status Sold Individually: Select to limit one product per order.    Global Attribute can be added in this section or you can create custom attribute and can add them to the product\'s attribute. You can add Global Attribute from here. Lets add Global Attributes to the product. Select an Attribute from the attribute select box and click Add. Choosing Color as Attribute Color Section opened when attribute is added To select value to that attribute click on the value select box or to select all the attributes at once, click on Select all. You can also add Custom value by Clicking on Add. Enter the value you want to add on that attribute and Click Add New. Adding custom value Adding a Custom Attribute Select Custom product Attribute from the attribute select box and click Add. Name the attribute (e.g., Size). Set values separated by a vertical pipe, | (e.g., Small | Medium | Large). Click Save Attribute to save Attribute with selected values. If you want to make the attribute visible in the frontend product page then tick mark the Visible on the product page option.  Up-sells are displayed on the product details page. It encourages user to buy better option/deals or to upgrade the product they are currently viewing. For example, if the user is viewing a old model smart phone, it will show the latest model is available as up-sell. Cross-sells are products that are compatible with the ones they\'re purchasing. As an example, if the user adds a smart phone to their cart, a headphone or charger can be shown as cross-sell products.. Related Products are recommendations in addition to a product, a customer is currently viewing. Purchase note: Enter an optional note to send the customer after they purchase the product. Estimated Delivery: Enter an number which indicates the estimated day to deliver the product. Enable Reviews: Enable/disable customer reviews for this product.   When adding a simple product, you can tick the Downloadable checkbox in the product type panel. This adds two new fields: Download limit: Limit on number of times the customer can download file. Enter -1 for unlimited re-downloads. Download Expiry: Enter a number which will indicates the days of the file will be available. For maximum flexibility, downloadable products can also have a shipping cost (for example, if you were offering a product which can have both a packaged and a downloadable version then this would be ideal). You can also enable the Virtual product box if the downloadable product is not shippable.  Select External/Affiliate from the product type dropdown. The Product data metabox will change in this case. Shipping section will be removed and two options will be added in the general section. The Product URL field is the destination where users can purchase this product. And Button text will be shown on the button linking to the product URL. Customer will view the external product just like simple product view. In this case, Clicking on the button will take user to the button\'s link destination.  Grouped product is a collection of other products that already in your shop. So, it does not need stock to manage, services or shipping because the products already have those information. For example: A baby dress set; which could include baby dress, shoes, accessories etc. To create a grouped product, Select Grouped Product from Product Data dropdown.  Several fields will disappear including price, tax, stock. Enter SKU, Attribute to the product from their respective sections. To add products to the group, Go to Advanced Section.  A new option is added to advanced section, Grouped product. Select the Grouped Products, and search for the product by typing minimum 3 letters. Select your desired products. Every type of product can be added under the grouped product except another grouped product. Admin can add any vendors product to a grouped product. But Vendor can only add their own product to a grouped product. In frontend, the products under the grouped product will show in a list. View of a Grouped Product Variable product view on grouped product Variable product has button to select its options and External Product has button which is linking to the product URL. Every product on the grouped can be bought individually. After adding to the cart, customer can purchase the product as usual. One of the trickier product types is the variable product. They enable you to specify variations of a single product, each of which may have a distinct SKU, cost, or stock level. For instructions on creating a product with variations, see our Documentation on Variable Product.   SEO is the process used to optimize a website\'s technical configuration, content relevance and link popularity so its pages can become easily findable, more relevant and popular towards user search queries.
Fill up Meta Title, Meta Description and upload images to Meta Images and save it for SEO process.  when Vendor adding a product, vendor adding section will be omitted.  Add keywords according to your product so that, a customer can easily search and find the product.   Pending Review is used when vendor adds a product. It needs to be reviewed by Admin before publishing the product. Admin also have the right to change this option from MartVill Dashboard > Configuration > Products     OR,  A MartVill Product Code is sometimes needed when using shortcodes, widgets, and links.  Hover over the product you need the code for in All Products to locate it. It displays the product code number. If you are controlling stock for a product, choose whether to accept backorders from the selection. To accept backorders, you must select Manage stock.  When Managed stock is checked, there are Two dropdown options for under Allow backorders: ',
